import React from 'react'
import styled from 'styled-components'
import sculture from '../images/sculture.png'

function Hero() {
    return (
        <Heroo>
            <HeroContainer>
                <div className="text">
                    <h1>Scultures</h1>
                </div>
                <div className="image">
                    <img src={sculture} alt="" srcset="" />
                </div>
            </HeroContainer>
        </Heroo>
    )
}

export default Hero

const Heroo = styled.div`
min-height: 80vh;
width: 100%;

display: flex;
`
const HeroContainer = styled.div`
width: 80%;
height: auto;

display: flex;


.text {
    width: 50%;

}
.image {
    width: 50%;
}

`
